import React from 'react';
import logo from './logo.svg';
import './App.css';
import HomeBody from './homepage';
import MovieList from './movies';

function Nav() {
  return (
    <div className="row">
      <img className="col-1" src="./4746048.png" />
      <h1 className="col-11"> Joel Hilton Movie Site</h1>
      <p>Home</p>
      <p>My Podcast</p>
      <p>Movie List</p>
    </div>
  );
}

function App() {
  return (
    <div>
      <Nav />
      <HomeBody />
      <MovieList />
    </div>
  );
}

export default App;
